"text-align: center;\">SV Tell Weilheim 3</li>\r\n<li style=\"text-align: center;\">WSV Mehrstetten</li>\r\n<li style=\"text-align: center;\">PSV Reutlingen 4</li>\r\n<li style=\"text-align: center;\">BS N&uuml;rtingen 3</li>\r\n</ul>',10),(11,'HOME','<h3>Willkommen auf der Seite der Bezirksliga A&nbsp; Bogen des Bezirks Neckar</h3>\r\n<p>Folgende Mannschaften nehmen im Sportjahr 2019 an der Bezirksliga A&nbsp; Bogen des Bezirks Neckar teil:&nbsp;</p>\r\n<ul>\r\n<li style=\"text-align: center;\">Archery-Team Neuffen-Kappish&auml;usern</li>\r\n<li style=\"text-align: center;\">BWT Kirchentellinsfurt 2</li>\r\n<li style=\"text-align: center;\">BWT Kirchentellinsfurt 3</li>\r\n<li style=\"text-align: center;\"></li>\r\n</ul>',11),(12,'HOME','<h1>Aufstiegswettkampf zur Landesoberliga Nord</h1>\r\n<p>Hier k&auml;mpfen die besten 8 Mannschaften der Landesliga A Stuttgart, Hohenlohe, Unterland und Mittelschwaben um den Aufstieg in die Landesoberliga Nord.</p>\r\n<p>Da es leider keine Landesliga A Hohenlohe dieses Jahr stattfand treten nur 6 Mannschaften gegeneinander an.</p>\r\n<p>Der Aufstiegswettkampf findet am<strong>&nbsp;12.02.2023</strong>&nbsp;in der<br /> Franz-Baum Halle, Welzheim statt.<br />Einschie&szlig;en ab 12:30 Uhr<br />Wettkampfbeginn ist <strong>13:00</strong> Uhr</p>\r\n<p>Teilnehmende Mannschaften sind:</p>\r\n<ol>\r\n<li>SGi Welzheim 4</li>\r\n<li>MTV Ludwigsburg</li>\r\n<li>BSC Eschenbach</li>\r\n<li>BSC Stuttgart 2</li>\r\n<li>BS Bietigheim</li>\r\n<li>SG Donzdorf</li>\r\n</ol>',12),(13,'HOME','<h1>Aufstiegswettkampf zur Landesoberliga S&uuml;d</h1>\r\n<p>Hier k&auml;mpfen die besten 6 Mannschaften den Landesliga A Schwarzwald-Hohenzollern, Oberschwaben und Neckar um den Aufstieg in die Landesoberliga S&uuml;d.</p>\r\n<p>Da dieses Jahr leider keine Landesliga A Schwarzwald-Hohenzollern stattfand, schie&szlig;en nur 4 Mannschaften um den Aufstieg.</p>\r\n<p>Der Aufstiegswettkampf findet am 01.03.2020 in der<br /> Bogenhalle, Altheim-Waldhausen statt.<br />Einschie&szlig;en ab 12:30 Uhr<br />Wettkampfbeginn ist 13:00 Uhr</p>\r\n<p>Teilnehmende Mannschaften sind:</p>\r\n<ol>\r\n<li>WSV Mehrstetten</li>\r\n<li>SV Hitzkofen</li>\r\n<li>SV Tell Weilheim 2</li>\r\n<li>SV Laupheim</li>\r\n</ol>',13),(14,'HOME','<h1>Endergebnis:</h1>\r\n<p><strong>1. SSG Vogel &Ouml;stringen</strong><br /><strong>2. SGi Bad Schussenried</strong><br /><strong>3. BS N&uuml;rtingen</strong><br /><strong>4. BSV Teningen</strong></p>\r\n<h1>Ergebnis Finals:</h1>\r\n<h2>Halbfinale:</h2>\r\n<p><span style=\"text-decoration: underline;\"><strong>SSG Vogel &Ouml;stringen</strong></span>&nbsp; <strong>4* : 4</strong>&nbsp; BS N&uuml;rtingen</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>SGi Bad Schussenried</strong></span>&nbsp; <strong>5 : 3</strong>&nbsp; BSV Teningen</p>\r\n<h2>Kleines Finale:</h2>\r\n<p><span style=\"text-decoration: underline;\"><strong>BS N&uuml;rtingen</strong></span>&nbsp; <strong>6 : 2</strong>&nbsp; BSV Teningen</p>\r\n<h2>Goldfinale:</h2>\r\n<p><span style=\"text-decoration: underline;\"><strong>SSG Vogel &Ouml;stringen</strong></span>&nbsp; <strong>5 : 3</strong>&nbsp; SGi Bad Schussenried</p>\r\n<h1>Informationen</h1>\r\n<p>Die Landesverb&auml;nde W&uuml;rttembergischer Sch&uuml;tzenverband 1850 e.V , Badischer Sportsch&uuml;tzenverband 1862 e.V. und der S&uuml;dbadische Sportsch&uuml;tzenverband f&uuml;hren einen Finalwettkampf der besten Compoundligamannschaften ihrer Verb&auml;nde durch.</p>\r\n<h3>Qualifikation:</h3>\r\n<p>Zu diesem Finale werden folgende Mannschaften eingeladen:</p>\r\n<p>Aus der W&uuml;rttembergliga Compound die Mannschaften der Pl&auml;tze 1 &ndash; 4<br />Aus der Badenliga Compound die Mannschaften der Pl&auml;tze 1 und 2<br />Aus der S&uuml;dbadenliga Compound die Mannschaften der Pl&auml;tze 1 und 2</p>\r\n<h2>Modus:</h2>\r\n<h3>Vorkampf:</h3>\r\n<p>Der Vorkampf besteht aus einem Ligawettkampf der 8 eingeladenen Vereine nach den Regeln der Ligaordnung und der Ausschreibung Liga Bogen des DSB.</p>\r\n<h3>Finale:</h3>\r\n<p>Die Mannschaften der Pl&auml;tze 1 -4 des Vorkampfs qualifizieren sich zum Finale. Dieses wird im KO System durchgef&uuml;hrt. Bei den Finals werden maximal 4 S&auml;tze geschossen. Die Mannschaft die zuerst 5 Satzpunkte erreicht hat den Finalkampf gewonnen. Bei einem Stand von 4 : 4 wird ein Stechen durchgef&uuml;hrt. Jeder Sch&uuml;tze der Mannschaft schie&szlig;t 1 Pfeil. Bei Ringgleichheit z&auml;hlt der zentrumsn&auml;chste Pfeil.<br />Die Finals wird nicht alternierend geschossen.</p>\r\n<p>Halbfinale: Platz 1 gegen Platz 4 und Platz 2 gegen Platz 3</p>\r\n<p>Kleines Finale: Verlierer des Halbfinals</p>\r\n<p>Goldfinale Gewinner des Halbfinals</p>',14),(15,'HOME','<h3 style=\"text-align: center;\">Willkommen auf der Seite der Landesliga A-Oberschwaben</h3>\r\n<p>&nbsp;</p>\r\n<p>Folgende Mannschaften nehmen im Sportjahr 2023 an der Bezirksoberliga Bogen des Bezirks Oberschwaben teil:</p>\r\n<ol>\r\n<li style=\"text-align: left;\">SV Laupheim</li>\r\n<li style=\"text-align: left;\">BSV Ulm</li>\r\n<li style=\"text-align: left;\">TG Biberach 2</li>\r\n<li style=\"text-align: left;\">BSC Laupheim 2</li>\r\n<li style=\"text-align: left;\">SV Hitzkofen</li>\r\n<li style=\"text-align: left;\">SV Laupheim 2</li>\r\n<li style=\"text-align: left;\">SV Kirchberg/Iller</li>\r\n</ol>\r\n<p style=\"text-align: center;\">die Mannschaft des SV Brochenzell hat sich leider abgemeldet.</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">Termine und Austragungsorte:</p>\r\n<p style=\"text-align: left;\"><strong>13.11.2022, 14.30 Uhr in der Bogenhalle des SV Essendorf, Hochdorfer Str. 30, 88454 Hochdorf</strong></p>\r\n<p style=\"text-align: left;\"><strong>29.01.2023, 14.30 Uhr in der Bogenhalle des SV Hitzkofen, Heudorfer Str., 72511 Hitzkofen</strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>',15),(16,'HOME','<h3 style=\"text-align: center;\"><em><strong>Willkommen auf der Seite der Landes